JAV it magnetas traukia vis daugiau Lietuvos plaukimo talentų. Trys Europos čempionate Kopenhagoje dalyvavę lietuviai savo plaukimo įgūdžius tobulina už Atlanto. Prie savo vardą jau išsikovojusių Simono Bilio, Tado Duškino ir U. Mažutaitytės nuo šių metų rudens prisidėjo šiaulietis Valdas Abalikšta ir kaunietė  Diana Jaruševičiūtė . Saulėtoje Kalifornijoje esančiame penktame pagal dydį valstijos mieste Fresne U. Mažutaitytė jau trečius metus kremta masinės komunikacijos ir reklamos kūrimo bakalauro studijas bei atstovauja universiteto plaukimo komandai. Paklausta, ar nesigaili pasirinkimo, kaunietė sakė, kad apie tai negali būti nė kalbos. „Nuo penktos klasės mokykloje apie tai galvojau“, – duodama interviu DELFI juokėsi iššūkius mėgstanti mergina. Plaukimo nugara rungties specialistė vėliau pokalbyje atkreipė dėmesį, kad gyvenime ją dažnai egzaminuoja tarsi iš dangaus nukrentančios problemos, tačiau ji su pavydėtinu uolumu jas įveikia. Viena iš šviežiausiųjų – prieš Europos čempionatą Danijoje plaukikė tris paras buvo įstrigusi Londono oro uoste ir Kopenhagą pasiekė tik varžybų išvakarėse. Tačiau net ir tai neišmušė jos iš vėžių. Pagrindinėje savo rungtyje – 200 m plaukimo nugara – distanciją per 2 min. 08,33 sek. įveikusi Ugnė užėmė 12-ą vietą tarp 28-ių dalyvių. Vėliau jau Lietuvoje vykusiame čempionate šioje rungtyje ji nesunkiai laimėjo aukso medalį. Jardais matuojamų Amerikos baseinų vandenis prisijaukinusios U. Mažutaitytės trofėjų lentynoje greitai nebus kur dulkei nusėsti – dvejus pastaruosius metus lietuvė tapo „Mountain West“ konferencijos čempione, pernai plaukė JAV studentų asociacijos (NCAA) pirmenybėse, pagerino šešis universiteto rekordus, daug kartų rinkta tiek universiteto, tiek konferencijos MVP (naudingiausia sportininke). „Čia plaukiame daugiau nei mokomės, bet mokytis vis tiek reikia“, – atskleidė studijų ir treniruočių balansą už Atlanto vandenyno dvidešimtmetė, kurios venomis veikiausiai teka jau ne kraujas, o baseino vanduo. Kodėl? Ugnės seneliai ir tėvai – garsūs Lietuvos plaukikai, rekordininkai ir treneriai. Ji – solidžios plaukimo dinastijos atstovė. Tačiau ir tai nesugebėjo sulaikyti U. Mažutaitytės Lietuvoje. „Man reikėjo permainų“, – trumpai drūtai nukirto plaukikė. – Kas paskatino ar motyvavo tokioms permainoms gyvenime? – Nemačiau savęs studijuojančios Lietuvoje. Rugilė Mileišytė, pusseserė Neringa ir visos draugės išvažiavo į Ameriką. Jau nuo 5-os klasės žinojau, kad važiuosiu į Ameriką. Galbūt todėl tie paskutiniai metai Lietuvoje buvo sunkūs. Kai pasirašiau sutartis, išvažiavau. Žinojau, kad tie ketveri metai Fresno universitete bus juodas darbas, bet kitur savęs nemačiau. – Kokia tai vieta, kuo ji išskirtinė? – Fresnas – penktas pagal dydį miestas Kalifornijos valstijoje. Ten nėra ką veikti – tik vynuogynai ir vynas. Universitete galima net baigti vynininko specialybę. Tačiau nuo Fresno iki Los Andželo – dvi valandos kelio, o iki San Francisko – trys valandos. Už valandos kelio – Josemičio nacionalinis parkas. Fresnas yra tobula vieta treniruotis ir mokytis. Daugiau laiko niekam nelieka. Tačiau Josemičio nacionaliniame parke galiu palaipioti po kalnus, San Franciske – išgerti kavos, o Los Andžele  pasurfinti . Sezonas prasideda nuo spalio ir tęsiasi iki vasario arba kovo mėnesio. Tuomet treniruotės kasdien po dukart, o savaitgaliais – varžybos. Kai duoda laisvo laiko, galėtume keliauti, bet kartais jau net nesinori – lieku namie ir miegu. – Amerika tapo tikru magnetu plaukikams. Kuo ji taip traukia? – Sukurta gera sistema. Pirmiausiai tie ketveri metai ten – nuostabus nuotykis. Pavyzdžiui, universitete ruošiame skanduotes. Kasdien reikia vienodai rengtis, vos ne iki apatinių marškinėlių, kojinių ir panašiai. Kartais net juokinga, tačiau jau treti metai studijuoju ir suprantu, kad ta dvasia labai svarbu. Kai plaukiu 200 jardų nugara, išsirikiuoja visa 20-ies narių komanda prie mano takelio ir rėkia taip, kad net po vandeniu girdžiu. O juk dažniausiai plaukiant nugara nieko negirdžiu. Tiesiog ta kultūra ir dvasia labai įdomi. Amerikoje tau sumoka už mokslą, o jei esi dar ir geras plaukikas, duos papildomai stipendiją. Kitaip tariant gauni išsilavinimą, diplomą, plauki ir ramiai gyveni. Lietuvoje to niekada negausi. Be to, Amerika yra viena greičiausių plaukimo šalių. Ten yra visas inventorius. Plaukiu atvirame baseine. Anksčiau paniškai bijojau atviro baseino, nes kai nugara plaukiu, atrodo, nėra stogo, tai nugrybausiu. Dabar stogas gali būti bet koks, vis tiek nuplauksiu. Amerika išmoko gerai prisitaikyti. Kur atvažiuoji, ten būna visokiausių taisyklių. Konferencijos varžybos trunka penkias dienas, tai nuo ryto iki vakaro stovi, sėdi, valgai, baseine plauki, mėgini pamiegoti. Turi greitai adaptuotis. Jei sunkiau to neištveri, nepatinka, tuomet grįžti namo. – Kodėl ne Australija? Juk ji taip pat garsėja kaip plaukimo rojus? – Iš tikrųjų visi ten dabar labai važiuoja. Viena mano draugė estė ten plaukia. Kalifornija man patinka, nes ten yra banglentės, kava, šviežias maistas. Australijoje iš tikrųjų tą patį gali rasti. Gal ir įdomu būtų, tačiau negalvojau apie tai. Ir mane labiau traukia Japonija, jos kultūra ir maistas. Jei pavyks, Fresne pabaigsiu ir japonų kalbos gretutines studijas. – Ar teko lankytis Tekančios saulės šalyje? – Turiu bilietą (plačiai šypsosi). Per pavasario atostogas skrisiu į Okinavą. Pasiimsiu kuprinę ir viena nukeliausiu savaitei. Man patinka keliauti. Yra toks posakis, kad nuotykis neprasideda, kol kažkas neatsitinka blogai. Gyvenu šia fraze. Man atsitinka tokie dalykai kaip Londono oro uoste (Ugnei prieš pat Europos čempionatą Kopenhagoje įstrigo Londono oro uoste trims paroms – DELFI). Iš pradžių žiauriai sunku, bet tokius dalykus išgyveni ir linksma. Tai – ne kiekvienam. Tai man suteikia stiprybės. Kartais galvoju, kad ta frazė mane persekioja. – Ką planuojate veikti pabaigusi studijas universitete? – Kai baigsiu varžytis NCAA pirmenybėse, galėsiu tapti profesionalia plaukike. Planuoju pasiimti iš plaukimo kaip įmanoma daugiau – pakeliauti, pamatyti pasaulį. Dažnai sulaukiu klausimų, o kas po Amerikos? Iš tikrųjų sunku ten likti. Yra trys variantai. Reikia padedamai advokatų gauti taip vadinamą žaliąją kortą, jei esi geras sportininkas, arba susirasti  amerikoną  ir už jo ištekėti, arba ieškoti darbo. Tų dalykų nenoriu imtis, tad nematau problemos grįžti namo. Lietuvoje galėčiau su vynu pradėti dirbti. Čia tokia svajonė. Bet ir tai – trapus dalykas. – O kokia plaukikės Ugnės svajonė ar tikslas? – Didžiausias pasiekimas visiems sportininkams yra olimpiada. Ne paslaptis, kad ten norėčiau nuvykti. Tačiau dažniausiai žmonės labai  užsiciklina  su olimpiada, medaliais. Juokingiausia, kad man geriausios varžybos gyvenime buvo Bonoje, Vokietijoje. Pastaraisiais metais su drauge vienos nuvykome, buvo Kalėdų metas, mugė. Man tos varžybos buvo smagiausios gyvenime, nors tikrai nereikšmingos, buvo ten net mažų vaikų plaukimas. Mano tikslas – kuo daugiau nuotykių, nesąmonių, kur turėčiau adaptuotis, įveikti kliūtis. Noriu išeiti iš plaukimo stipri, pasitikinti savimi ir žengti toliau, kažką kita veikti. – Jūsų giminėje vieni plaukikai. Veikiausiai baseino vanduo jau teka jūsų venomis. Kiek įtakos tai turėjo pasirenkant šią sporto šaką? – Neprisimenu, kada pradėjau plaukti. Mama pasakojo, kad maža būdama net bijojau vandens. Mano tėtis, kaip pagrindinis treneris su Lietuvos plaukimo rinktine, išvyko į Sidnėjaus olimpiadą. Man buvo 3-eji metai, o aš per „Eurosport“ kanalą žiūrėjau, kaip tėčio plaukikai  Saulius Binevičius , Rolandas Gimbutis plaukia. Įdomu, kad aš ne „teletabius“, o „Eurosport“ žiūrėjau, laukiau plaukimo. Nemokėjau tuomet plaukti vandenyje, tai plaukdavau ant kilimo. Tai turėjo įtakos. Kai ateidavo tėčio plaukikai – tokie po du metrus ūgio, man mažytei jie kaip kokie dievai atrodydavo. Tikri idealai. Galiausiai močiutė nuo 5-erių metų išmokė mane plaukti. Pirmose varžybose buvo baisu, bet grįžusi namo nupiešiau piešinį, kurį mama įrėmino ir dar iki šiol laiko. – Kodėl pasirinkote plaukimo nugara rungtį? – Vaikus pirmiausiai moko plaukti nugara, nes taip lengviausia išmokti. Pradėjau nuo nugaros, kiti būdai netiko, gal neturėjau to slinkimo. Močiutė pamatė, kad turiu talentą. Dabar universitete kartais  krauliu  plaukiu ilgus nuotolius, galiu ištverti tuos krūvius. Neseniai Čikagoje lapkritį mane juokais „įmetė“ į plaukimo kompleksiniu būdu rungtį ir aš  sumušiau  mokyklos rekordą. (function(d, s, i, r) {
