		})(document, 'script', 'facebook-jssdk', 'fb-root'); – Kokį turite ritualą? Kas padeda susikaupti prieš startą? – Klausau vien korėjiečių popso. Čia mano Achilo kulnas. Jei negausiu savo koriejiečių paklausyti, tai man šakės. Juos dievinu, klausau, jie labai patinka. Mėgstamiausia daina – „G-Dragon“ grupės „Crooked“. Be tos dainos niekur negaliu eiti. Suprantu reikšmę ir noriu mokytis korėjiečių kalbos. Pasaulyje korėjiečių popsas labai populiarus ir fanai išverčia tų dainų žodžius. – Esate pasaulio žmogus, daug keliaujate, domitės kitomis kultūromis. O ar su Lietuva turite ryšį? – Turiu stiprų ryšį. Mano mama – didelė Lietuvos patriotė. Per vasario 16-ąją rengiamės tautinius drabužius ir einame į miestą. Mums nėra gėda ar nepatogu. Lietuva man labai svarbi. Jei universitete plaukiu, būtinai po Fresno universiteto kepurėle užsidedu Lietuvos kepurėlę. Mes turime tiek daug gerų plaukikų, sportininkų. Tai nuostabu. Tokia maža šalis, daug pasiekėme.
